create table user_answer
(
    id                    bigint not null
        constraint user_answer_pkey
            primary key,
    description           varchar(255),
    report_date           timestamp,
    id_answer             bigint not null
        constraint fk14nftl45j43vo75j8ynfws1lc
            references answers
            on delete cascade,
    id_questionnaire_type bigint not null
        constraint fkrff53hjy4kfp5y1aitv607kue
            references questionnaire_type
            on delete cascade,
    id_questions          bigint not null
        constraint fka7q3039whwf3ivhnl8x579bmv
            references questions
            on delete cascade,
    id_user               bigint not null
        constraint fkivnh5cgctl9c1pj8v93jjyo33
            references users
            on delete cascade
);

alter table user_answer
    owner to postgres;

